//Componente que contiene la interfaz de una barra de navegación superior, con varios botones

export function Navbar() {
    return (
        <div className="navbar">
            <ul className="navbar-list">
                <li className="navbar-item"><a href="#">Portada</a></li>
                <li className="navbar-item"><a href="#">Libros</a></li>
                <li className="navbar-item"><a href="#">Autores</a></li>
                <li className="navbar-item"><a href="#">Géneros</a></li>
            </ul>
        </div>
    );
}
